import FetchService from "./fetchService";

const API = "http://localhost:5000";
class UserService extends FetchService {
  async loadUserData(body) {
    const options = this.createOption("POST", body);
    const response = await this.fetch(API, options);
    

    try {
      const response = await fetch(API + "/Health-Website/get_user", options);
      const data = await response.json();
      return data;
    } catch (error) {
      return console.log(error);
    }
  }
}

export default new UserService();
